En Suisse, le système des trois piliers est le système sur lequel repose la prévoyance vieillesse, survivants et invalidité. Défini dans la constitution, il repose sur les trois principes suivants :1er pilier : l'assurance-vieillesse et survivants (AVS), qui permet de couvrir les besoins vitaux à la retraite ainsi que l'assurance-invalidité (AI), est garanti par l'État;
2e pilier : la prévoyance professionnelle, qui doit permettre aux assurés de maintenir leur niveau de vie antérieur, est garanti par les employeurs;
3e pilier : la prévoyance individuelle, qui est basée sur l'épargne volontaire effectuée par les assurés, est donc à la charge des individus.

