L’écriture hiéroglyphique égyptienne est un système d'écriture figurative : les caractères qui la composent représentent des objets divers — naturels ou produits par l'Homme — tels que des plantes, des figures de dieux, d'humains et d'animaux, etc., regroupés en catégories. Les égyptologues y distinguent traditionnellement trois catégories de signes :les signes-mots, qui représentent un objet ou, par métonymie, une action ;
les signes phonétiques, qui notent un son ;
les déterminatifs, signes « muets » qui indiquent le champ lexical auquel appartient le mot.
